/**
 * Module with the client app router.
 * @module src/client/app-router
 */

// React.
import React, { PropTypes } from 'react';
import { Router } from 'react-router';
import { configureRoutes } from '../shared/utils/';

/**
 * Client app router component.
 * @param {Object} props -> The component properties.
 * @returns {ReactElement} -> The react router.
 */
const AppRouter = ({ history, store }) => (
  <Router
    history={history}
    routes={configureRoutes(store)}
  />
);

/**
 * PropTypes.
 * @property {Object} history -> The browser history.
 * @property {Object} store -> The redux store.
 */
AppRouter.propTypes = {
  history: PropTypes.shape().isRequired,
  store: PropTypes.shape().isRequired
};

export default AppRouter;

import React, { Component, PropTypes } from 'react';
import { bindActionCreators } from 'redux';
import { connect } from 'react-redux';
import { routerActions } from 'react-router-redux';

const authWrapper = (options) => {
  const {
    authSelector,
    predicate,
    replaceRoute
  } = options;

  const isAuthorized = data => (predicate(data));

  function wrapComponent(ComposedComponents) {
    class Authenticate extends Component {
      static propTypes = {
        actions: PropTypes.shape().isRequired,
        user: PropTypes.shape().isRequired
      };

      componentWillMount() {
        if (!isAuthorized(this.props.user)) {
          this.props.actions.push(replaceRoute);
        }
      }

      componentWillReceiveProps(nextProps) {
        if (!isAuthorized(nextProps.user)) {
          this.props.actions.push(replaceRoute);
        }
      }

      render() {
        return (<ComposedComponents {...this.props} />);
      }
    }

    return connect(
      (state, ownProps) => ({ user: authSelector(state, ownProps) }),
      dispatch => ({
        actions: bindActionCreators({ ...routerActions }, dispatch)
      })
    )(Authenticate);
  }

  return wrapComponent;
};

export default authWrapper;

import React, { PropTypes } from 'react';

// Utils.
import { componentHelpers } from '../../../shared/utils/';

// Styles.
import '../../styles/components/_button.scss';

const Button = ({
  id,
  type,
  children,
  className,
  onClick,
  group,
  size,
  block,
  close,
  theme,
  layout
}) => {
  const componentClass = 'c-button';
  let config = '';

  config += componentHelpers.generateComponentStyleConfig(componentClass, [
    theme,
    layout
  ]);

  if (block) {
    config += `${componentClass}--block `;
  }

  if (close) {
    config += `${componentClass}--close `;
  }

  if (size) {
    config += `u-${size} `;
  }

  config += className || '';

  return (
    <button
      id={id}
      type={type}
      data-group={group}
      className={`c-button ${config.trim()}`}
      onClick={onClick}
    >
      {children}
    </button>
  );
};

Button.propTypes = {
  id: PropTypes.string,
  children: PropTypes.node,
  className: PropTypes.string,
  onClick: PropTypes.func,
  group: PropTypes.string,
  type: PropTypes.string,
  size: PropTypes.string,
  block: PropTypes.bool,
  close: PropTypes.bool,
  theme: PropTypes.string,
  layout: PropTypes.string
};

export default Button;

