/**
 * Module with the assign transporter container component.
 * @module src/client/containers/assign-transporter
 */
// React - Redux.
import React, { PropTypes, Component } from 'react';
import { bindActionCreators } from 'redux';
import { connect } from 'react-redux';

// Components.
import {
  Grid,
  GridCell,
  DataTable,
  DataHeader,
  DataContent,
  DataRow,
  DataItem,
  BoxContainer,
  InputGroup,

  Button,
  InputBox,
  SelectBox,
  CheckBox
} from '../components/';

// Lib.
import validator from '../../shared/lib/validator';

// Actions.
import {
  updateSerializedDataTable,
  updateSelectedDataTable
} from '../../shared/actions/data-table-actions';
import {
  updateDistributorFormTransporter,
  updateDistributorFormDistributors,
  assignDistributorRequest,
  updateTransportersFilter
} from '../../shared/actions/transporters-actions';
import { updateRulesValidation } from '../../shared/actions/form-rules-actions';

// Constants.
import {
  MEDIUM_SIZE,
  XLARGE_SIZE
} from '../../shared/constants/types';
import { TRANSPORTER } from '../../shared/constants/user-types';
import {
  SELECT_TRANSPORTER_INPUT
} from '../constants/strings';
import {
  DISTRIBUTOR_FORM,
  DISTRIBUTORS_FILTER,
  DISTRIBUTOR_FORM_RULES
} from '../../shared/constants/strings';

// Styles.
import '../styles/assign-transporter.scss';

class AssignDistributors extends Component {
  static propTypes = {
    actions: PropTypes.shape().isRequired,
    form: PropTypes.shape(),
    filter: PropTypes.string,
    users: PropTypes.arrayOf(PropTypes.object),
    dataTable: PropTypes.shape(),
    formRules: PropTypes.shape()
  };

  constructor(props) {
    super(props);

    this.state = {
      headers: [
        { text: 'Usuario', size: 40 },
        { text: 'Nombre', size: 40 },
        { text: 'Seleccionar', size: 20 }
      ]
    };
  }

  /**
   * Maps the transporter users to the select box.
   * @param {Array} users -> The list of all users.
   * @returns {Array} -> The mapped users.
   */
  mapTransporterUsers = users => (
    users
      .filter(user => (user.IdTipo === TRANSPORTER))
      .map(user => ({
        value: user.Idusuario,
        text: user.StrNombre
      }))
  );

  /**
   * Map the distributor users.
   * @param {Array} distributors -> The current list of distributors.
   * @returns {Array} -> List of ReactElements.
   */
  mapDistributors = distributors => (
    distributors.map((distributor, key) => (
      <DataRow key={key}>
        <DataItem center width={40}>{distributor.Strusuario}</DataItem>
        <DataItem center width={40}>{distributor.StrNombre}</DataItem>
        <DataItem width={20}>
          <InputGroup center>
            <CheckBox
              name="select_distributors"
              value={distributor.Idusuario.toString()}
              valid={this.props.formRules.distributors.valid}
              onChange={this.handleSelectDistributor(distributor.Idusuario)}
            />
          </InputGroup>
        </DataItem>
      </DataRow>
    ))
  );

  /**
   * Handle data table paginator click.
   * @param {Number} idData -> The id of the chunk.
   * @param {DOMEvent} event -> The element event.
   * @returns {void}
   */
  handlePaginatorClick = idData => (event) => {
    event.preventDefault();
    this.props.actions.updateSelectedDataTable(
      DISTRIBUTOR_FORM,
      idData
    );
  };

  /**
   * Handle select transporter user.
   * @param {DOMEvent} event -> The element event.
   * @returns {void}
   */
  handleSelectTransporter = (event) => {
    event.preventDefault();
    const idTransporter = parseInt(event.target.value, 10);
    const [selectedUser] = this.props.users
      .filter(user => (user.Idusuario === idTransporter));
    this.props.actions.updateDistributorFormTransporter(
      (isNaN(idTransporter)) ? '' : idTransporter.toString(),
      (isNaN(idTransporter)) ? '' : selectedUser.StrNombre
    );
  };

  /**
   * Handle select distributor user.
   * @param {String} idDistributor -> The distributor id.
   * @param {DOMEvent} event -> The element event.
   * @returns {void}
   */
  handleSelectDistributor = idDistributor => () => {
    this.props.actions.updateDistributorFormDistributors(idDistributor);
  };

  /**
   * Handle submit of the transporter assign.
   * @param {DOMEvent} event -> The element event.
   * @returns {void}
   */
  handleSubmitForm = () => {
    const { form, formRules } = this.props;
    const formValidation = validator.run(formRules, form);

    this.props.actions.updateRulesValidation(
      DISTRIBUTOR_FORM_RULES,
      formValidation.resume
    );

    if (formValidation.valid) {
      this.props.actions.assignDistributorRequest();
    }
  };

  /**
   * Handle changes on the filter.
   * @param {DOMEvent} event -> The element event.
   * @returns {void}
   */
  handleFilterChanges = (event) => {
    const { value } = event.target;
    const filteredUsers = this.props.users
        .filter(user => (
          user.StrNombre.toUpperCase()
            .includes(value.toUpperCase()) &&
          user.IdTipo === TRANSPORTER
        ));

    this.props.actions.updateTransportersFilter(
      DISTRIBUTORS_FILTER,
      value
    );

    this.props.actions.updateSerializedDataTable(
      DISTRIBUTOR_FORM,
      filteredUsers
    );
  };

  render() {
    const {
      form,
      users,
      filter,
      formRules,
      dataTable
    } = this.props;
    return (
      <BoxContainer
        pillar
        size={MEDIUM_SIZE}
      >
        <h2 className="c-heading">Asignar Ditribuidores</h2>
        <Grid noGutter>
          <GridCell width={20}>
            <SelectBox
              id="user_transporter"
              name="user_transporter"
              placeholder={SELECT_TRANSPORTER_INPUT}
              value={form.idTransporter}
              valid={formRules.idTransporter.valid}
              options={this.mapTransporterUsers(users)}
              onChange={this.handleSelectTransporter}
            />
          </GridCell>
          <GridCell width={20} offset={5}>
            <p className="user-name-box">{form.nameTransporter}</p>
          </GridCell>
          <GridCell width={20} offset={15}>
            <InputBox
              value={filter}
              placeholder="Filtrar transportadores"
              onChange={this.handleFilterChanges}
            />
          </GridCell>
        </Grid>
        <Grid
          wrap
          noGutter
          className="u-letter-box--medium"
        >
          <GridCell width={80}>
            <DataTable
              selected={dataTable.selectedData.id}
              paginators={dataTable.paginators}
              onClickPaginator={this.handlePaginatorClick}
            >
              <DataHeader>
                {this.state.headers.map((title, key) => (
                  <DataItem key={key} width={title.size}>
                    {title.text}
                  </DataItem>
                ))}
              </DataHeader>
              <DataContent>
                {(dataTable.selectedData.list) ?
                  this.mapDistributors(dataTable.selectedData.list) : ''}
              </DataContent>
            </DataTable>
            <p>
              <Button
                size={XLARGE_SIZE}
                onClick={this.handleSubmitForm}
              >
                Asignar
              </Button>
            </p>
          </GridCell>
        </Grid>
      </BoxContainer>
    );
  }
}

export default connect(
  state => ({
    form: state.transporters.distributorForm,
    filter: state.transporters.filters.ditributorsFilter,
    users: state.users.list,
    dataTable: state.dataTable.distributorFormTable,
    formRules: state.formRules.distributorForm
  }),
  dispatch => ({
    actions: bindActionCreators({
      updateSelectedDataTable,
      updateDistributorFormTransporter,
      updateDistributorFormDistributors,
      assignDistributorRequest,
      updateRulesValidation,
      updateTransportersFilter,
      updateSerializedDataTable
    }, dispatch)
  })
)(AssignDistributors);

/**
 * Module with the assign transporter container component.
 * @module src/client/containers/assign-transporter
 */
// React - Redux.
import React, { PropTypes, Component } from 'react';
import { bindActionCreators } from 'redux';
import { connect } from 'react-redux';

// Components.
import {
  Grid,
  GridCell,
  Table,
  TableHead,
  TableRow,
  TableCell,
  BoxContainer,

  Button,
  InputBox,
  CheckBox,
  SelectBox
} from '../components/';

// Actions.
import {
  toggleOrderToAssign,
  updateOrdersToAssignFilter,
  updateDistributorUserToAssign,
  assignOrdersToDistributorRequest
} from '../../shared/actions/assign-orders-actions';
import {
  updateRulesValidation
} from '../../shared/actions/form-rules-actions';

// Lib.
import validator from '../../shared/lib/validator';

// Constants.
import {
  DISTRIBUTOR_TO_ASSIGN_INPUT,
  ORDERS_ZONE_FILTER_INPUT,
  ORDERS_NUM_FILTER_INPUT,

  DISTRIBUTOR_TO_ASSIGN_INPUT_ID,
  ORDERS_ZONE_FILTER_INPUT_ID,
  ORDERS_NUM_FILTER_INPUT_ID,
  ORDERS_TO_ASSIGN_INPUT_ID
} from '../constants/strings';
import {
  MEDIUM_SIZE,
  XLARGE_SIZE
} from '../../shared/constants/types';
import {
  ORDERS_NUM_FILTER,
  ORDERS_ZONE_FILTER,
  ASSIGN_ORDERS_FORM_RULES
} from '../../shared/constants/strings';

class PackageReception extends Component {
  static propTypes = {
    filters: PropTypes.shape({
      zonesFilter: PropTypes.string,
      ordersFilter: PropTypes.string
    }),
    distributorUser: PropTypes.string,
    ordersToAssignList: PropTypes.arrayOf(PropTypes.object),
    toggleOrderToAssign: PropTypes.func,
    updateOrdersToAssignFilter: PropTypes.func,
    updateDistributorUserToAssign: PropTypes.func,
    assignOrdersToDistributorRequest: PropTypes.func,
    formRules: PropTypes.shape({
      distributorUser: PropTypes.object,
      ordersToAssignList: PropTypes.object
    }),
    updateRulesValidation: PropTypes.func
  };

  constructor(props) {
    super(props);

    this.state = {
      headers: [
        { text: 'Zona' },
        { text: 'Tipo de Empaque' },
        { text: 'Nmero de Empaque' },
        { text: 'Nmero de Pedido' },
        { text: 'Cdigo de Producto' },
        { text: 'Cantidad' },
        { text: 'Asignar' }
      ]
    };
  }

  /**
   * Maps the orders to be displayed.
   * @param {Array} orders -> The orders.
   * @param {Bool} valid -> The forms validator.
   * @returns {Array} -> Array of Data Rows components.
   */
  mapOrders = (orders, valid) => (
    orders.map(order => (
      <TableRow key={`order_${order.id}`}>
        <TableCell center>
          {order.StrZona}
        </TableCell>
        <TableCell center>
          {order.StrTipoEmpaque}
        </TableCell>
        <TableCell center>
          {order.NumEmpaque}
        </TableCell>
        <TableCell center>
          {order.NumPedido}
        </TableCell>
        <TableCell center>
          {order.StrCodigoProducto}
        </TableCell>
        <TableCell center>
          {order.IntCantidad}
        </TableCell>
        <TableCell center>
          <CheckBox
            name={ORDERS_TO_ASSIGN_INPUT_ID}
            valid={valid}
            checked={order.checked}
            onChange={this.handleToggleOrder(order.id)}
          />
        </TableCell>
      </TableRow>
    ))
  );

  /**
   * Toggles a specific order.
   * @param {String} id -> The order id.
   * @returns {void}
   */
  handleToggleOrder = id => () => {
    this.props.toggleOrderToAssign(id);
  };

  /**
   * Handle the filters updates.
   * @param {String} type -> The type of filter.
   * @param {DOMEvent} event -> The input event.
   * @returns {void}
   */
  handleFiltersUpdates = type => (event) => {
    const { value } = event.target;
    this.props.updateOrdersToAssignFilter(type, value);
  };

  /**
   * Handle the selection of the distributor to assign orders.
   * @param {DOMEvent} event -> The input event.
   * @returns {void}
   */
  handleDistributorSelection = (event) => {
    event.preventDefault();
    const { value } = event.target;
    this.props.updateDistributorUserToAssign(value);
  };

  /**
   * Handles the submit of the checked orders.
   * @return {void}
   */
  handleSubmitForm = () => {
    const {
      formRules,
      distributorUser,
      ordersToAssignList
    } = this.props;

    const formValidation = validator.run(formRules, {
      distributorUser,
      ordersToAssignList
    });

    this.props.updateRulesValidation(
      ASSIGN_ORDERS_FORM_RULES,
      formValidation.resume
    );

    if (formValidation.valid) {
      this.props.assignOrdersToDistributorRequest();
    }
  }

  /**
   * Filters the orders based on the current filter values.
   * @param {Object} filters -> The filters.
   * @param {Array} orders -> The orders.
   * @returns {Array} -> The filtered orders.
   */
  filterOrders = (filters, orders) => (
    orders
      .filter(order => (
        order.StrZona.toUpperCase()
          .includes(filters.zonesFilter.toUpperCase())
      ))
      .filter(order => (
        order.NumPedido.toString().toUpperCase()
          .includes(filters.ordersFilter.toUpperCase())
      ))
  );

  render() {
    const {
      filters,
      formRules,
      distributorUser,
      ordersToAssignList
    } = this.props;
    const filteredOrders = this.filterOrders(ordersToAssignList, filters);

    return (
      <BoxContainer
        window
        size={MEDIUM_SIZE}
      >
        <h2 className="c-heading">Asignacin de Paquetes</h2>
        <Grid noGutter>
          <GridCell width={20}>
            <SelectBox
              id={DISTRIBUTOR_TO_ASSIGN_INPUT_ID}
              name={DISTRIBUTOR_TO_ASSIGN_INPUT_ID}
              value={distributorUser}
              valid={formRules.distributorUser.valid}
              placeholder={DISTRIBUTOR_TO_ASSIGN_INPUT}
              options={[{ value: 'test', text: 'test' }]}
              onChange={this.handleDistributorSelection}
            />
          </GridCell>
          <GridCell width={20}>
            <InputBox
              id={ORDERS_ZONE_FILTER_INPUT_ID}
              placeholder={ORDERS_ZONE_FILTER_INPUT}
              onChange={this.handleFiltersUpdates(ORDERS_ZONE_FILTER)}
            />
          </GridCell>
          <GridCell width={20} offset={5}>
            <InputBox
              id={ORDERS_NUM_FILTER_INPUT_ID}
              placeholder={ORDERS_NUM_FILTER_INPUT}
              onChange={this.handleFiltersUpdates(ORDERS_NUM_FILTER)}
            />
          </GridCell>
        </Grid>
        <Grid
          wrap
          noGutter
          className="u-letter-box--medium"
        >
          <GridCell width={100}>
            <Table>
              <TableHead
                center
                titles={this.state.headers}
              />
              {filteredOrders.length > 0 ?
                this.mapOrders(filteredOrders, formRules.valid) : (
                  <TableRow>
                    <TableCell center>
                      No hay paquetes en el momento.
                    </TableCell>
                  </TableRow>
                )}
            </Table>
          </GridCell>
        </Grid>
        <Grid noGutter>
          <GridCell width={20} offset={5}>
            <Button
              size={XLARGE_SIZE}
              onClick={this.handleSubmitForm}
            >
              Asignar Paquetes
            </Button>
          </GridCell>
        </Grid>
      </BoxContainer>
    );
  }
}

export default connect(
  state => ({
    ...state.assignOrders,
    dataTable: state.dataTable.assignOrdersFormTable,
    formRules: state.formRules.assignOrdersForm
  }),
  dispatch => (bindActionCreators({
    toggleOrderToAssign,
    updateOrdersToAssignFilter,
    updateDistributorUserToAssign,
    assignOrdersToDistributorRequest,
    updateRulesValidation
  }, dispatch))
)(PackageReception);

/**
 * Module with the assign transporter container component.
 * @module src/client/containers/assign-transporter
 */
// React - Redux.
import React, { PropTypes, Component } from 'react';
import { bindActionCreators } from 'redux';
import { connect } from 'react-redux';

// Components.
import {
  Grid,
  GridCell,
  DataTable,
  DataHeader,
  DataContent,
  DataRow,
  DataItem,
  BoxContainer,
  InputGroup,

  Button,
  InputBox,
  SelectBox,
  RadioButton
} from '../components/';

// Lib.
import validator from '../../shared/lib/validator';

// Actions.
import {
  updateSerializedDataTable,
  updateSelectedDataTable
} from '../../shared/actions/data-table-actions';
import {
  updateTransporterFormUser,
  updateTransporterFormMaster,
  assignTransporterRequest,
  updateTransportersFilter
} from '../../shared/actions/transporters-actions';
import { updateRulesValidation } from '../../shared/actions/form-rules-actions';

// Constants.
import {
  MEDIUM_SIZE,
  XLARGE_SIZE
} from '../../shared/constants/types';
import { TRANSPORTER } from '../../shared/constants/user-types';
import {
  SELECT_TRANSPORTER_INPUT
} from '../constants/strings';
import {
  TRANSPORTER_FORM,
  TRANSPORTERS_FILTER,
  TRANSPORTER_FORM_RULES
} from '../../shared/constants/strings';

// Styles.
import '../styles/assign-transporter.scss';

class AssignTransporter extends Component {
  static propTypes = {
    actions: PropTypes.shape().isRequired,
    transporters: PropTypes.arrayOf(PropTypes.object),
    form: PropTypes.shape(),
    users: PropTypes.arrayOf(PropTypes.object),
    filter: PropTypes.string,
    dataTable: PropTypes.shape(),
    formRules: PropTypes.shape()
  };

  constructor(props) {
    super(props);

    this.state = {
      headers: [
        { text: 'Nombre', size: 40 },
        { text: 'Documento', size: 40 },
        { text: 'Seleccionar', size: 20 }
      ]
    };
  }

  /**
   * Maps the transporter users to the select box.
   * @param {Array} users -> The list of all users.
   * @returns {Array} -> The mapped users.
   */
  mapTransporterUsers = users => (
    users
      .filter(user => (user.IdTipo === TRANSPORTER))
      .map(user => ({
        value: user.Idusuario,
        text: user.StrNombre
      }))
  );

  /**
   * Map the transporter masters.
   * @param {Array} masters -> The current list of masters.
   * @returns {Array} -> List of ReactElements.
   */
  mapMasters = masters => (
    masters.map((master, key) => (
      <DataRow key={key}>
        <DataItem width={40}>{master.StrNombre}</DataItem>
        <DataItem center width={40}>{master.StrDocumento}</DataItem>
        <DataItem width={20}>
          <InputGroup center>
            <RadioButton
              name="select_transporter_master"
              value={master.Id.toString()}
              valid={this.props.formRules.idTransporter.valid}
              onChange={this.handleSelectMaster(master.Id)}
              checked={master.Id === this.props.form.idTransporter}
            />
          </InputGroup>
        </DataItem>
      </DataRow>
    ))
  );

  /**
   * Handle data table paginator click.
   * @param {Number} idData -> The id of the chunk.
   * @param {DOMEvent} event -> The element event.
   * @returns {void}
   */
  handlePaginatorClick = idData => (event) => {
    event.preventDefault();
    this.props.actions.updateSelectedDataTable(
      TRANSPORTER_FORM,
      idData
    );
  };

  /**
   * Handle select transporter user.
   * @param {DOMEvent} event -> The element event.
   * @returns {void}
   */
  handleSelectUser = (event) => {
    event.preventDefault();
    const idUser = parseInt(event.target.value, 10);
    const [selectedUser] = this.props.users
      .filter(user => (user.Idusuario === idUser));
    this.props.actions.updateTransporterFormUser(
      (isNaN(idUser)) ? '' : idUser.toString(),
      (isNaN(idUser)) ? '' : selectedUser.StrNombre
    );
  };

  /**
   * Handle select transporter master.
   * @param {String} idTransporter -> The transporter master id.
   * @param {DOMEvent} event -> The element event.
   * @returns {void}
   */
  handleSelectMaster = idTransporter => () => {
    this.props.actions.updateTransporterFormMaster(idTransporter);
  };

  /**
   * Handle submit of the transporter assign.
   * @param {DOMEvent} event -> The element event.
   * @returns {void}
   */
  handleSubmitForm = () => {
    const { form, formRules } = this.props;
    const formValidation = validator.run(formRules, form);

    this.props.actions.updateRulesValidation(
      TRANSPORTER_FORM_RULES,
      formValidation.resume
    );

    if (formValidation.valid) {
      this.props.actions.assignTransporterRequest();
    }
  };

  /**
   * Handle changes on the filter.
   * @param {DOMEvent} event -> The element event.
   * @returns {void}
   */
  handleFilterChanges = (event) => {
    const { value } = event.target;
    const filteredUsers = this.props.transporters
        .filter(user => (user.StrNombre.toUpperCase().includes(value.toUpperCase())));

    this.props.actions.updateTransportersFilter(
      TRANSPORTERS_FILTER,
      value
    );

    this.props.actions.updateSerializedDataTable(
      TRANSPORTER_FORM,
      filteredUsers
    );
  };

  render() {
    const {
      form,
      users,
      filter,
      formRules,
      dataTable
    } = this.props;
    return (
      <BoxContainer
        pillar
        size={MEDIUM_SIZE}
      >
        <h2 className="c-heading">Asignar Transportador</h2>
        <Grid noGutter>
          <GridCell width={20}>
            <SelectBox
              id="user_transporter"
              name="user_transporter"
              placeholder={SELECT_TRANSPORTER_INPUT}
              value={form.idUser}
              valid={formRules.idUser.valid}
              options={this.mapTransporterUsers(users)}
              onChange={this.handleSelectUser}
            />
          </GridCell>
          <GridCell width={20} offset={5}>
            <p className="user-name-box">{form.nameUser}</p>
          </GridCell>
          <GridCell width={20} offset={15}>
            <InputBox
              value={filter}
              placeholder="Filtrar transportadores"
              onChange={this.handleFilterChanges}
            />
          </GridCell>
        </Grid>
        <Grid
          wrap
          noGutter
          className="u-letter-box--medium"
        >
          <GridCell width={80}>
            <DataTable
              selected={dataTable.selectedData.id}
              paginators={dataTable.paginators}
              onClickPaginator={this.handlePaginatorClick}
            >
              <DataHeader>
                {this.state.headers.map((title, key) => (
                  <DataItem key={key} width={title.size}>
                    {title.text}
                  </DataItem>
                ))}
              </DataHeader>
              <DataContent>
                {(dataTable.selectedData.list) ?
                  this.mapMasters(dataTable.selectedData.list) : ''}
              </DataContent>
            </DataTable>
            <p>
