/**
 * Module with a series of serialization functions.
 * @module src/shared/utils/serializer
 */
// Node.
import shortid from 'shortid';
import splitArray from 'split-array';

// Constants.
import {
  DISTRIBUTOR,
  TRANSPORTER_STRING,
  DISTRIBUTOR_STRING,
  DIRECTOR_STRING,
  ADMIN_STRING
} from '../constants/user-types';
import { CHUNK_QUANTITY } from '../constants/values';

// User Types.
const userTypes = [
  TRANSPORTER_STRING,
  DISTRIBUTOR_STRING,
  DIRECTOR_STRING,
  ADMIN_STRING
];

/**
 * Returns the user type based on the id.
 * @private
 * @param  {String} typeId -> The id of the type.
 * @returns {String} -> The user type.
 */
const getUserType = typeId => (userTypes[typeId - 1]);

/**
 * Serialize new user form.
 * @param  {Object} data -> The form data.
 * @returns {Object} -> The serialized object.
 */
const toNewUser = data => ({
  StrUsuario: data.username,
  StrPassword: data.password,
  StrNombre: data.fullname,
  IdTipo: data.type,
  StrNombreTipoUsuario: getUserType(data.type)
});

const toOrderToAssign = data => ({
  strUsuario: data.username,
  idTrasportista: data.idTransporter,
  numPedido: data.numOrder
});

const toOrderToDeliver = data => ({
  numPedido: data.numOrder,
  urlImagen: data.urlPicture,
  urlCod: data.urlCode
});

/**
 * Serialize distributor users.
 * @param {Array} users -> The array of users.
 * @returns {Array} -> The serialized array.
 */
const toDistributorUsers = users => (
  users
    .filter(user => (user.IdTipo === DISTRIBUTOR))
    .map(user => ({
      id: user.Idusuario,
      assign: false
    }))
);

/**
 * Serialize to data table set.
 * @param {Array} data -> The array of data.
 * @returns {Array} -> The serialized array.
 */
const toDataTableSet = data => (
  splitArray(data, CHUNK_QUANTITY)
    .map((chunk, id) => ({
      id,
      list: chunk
    }))
);

/**
 * Deserialize the data table set.
 * @param {Array} data -> The arrat of data.
 * @returns {Array} -> The deserialized data.
 */
const toDeserializedDataTableSet = data => (
  data.reduce((flattened, chunk) => ([
    ...flattened,
    ...chunk.list
  ]), [])
);

/**
 * Serialize to data table paginator data.
 * @param {Array} data -> The array of data.
 * @returns {Array} -> The serialized array.
 */
const toDataTablePaginators = data => (
  data.map(chunk => (
    { value: chunk.id, text: chunk.id + 1 }
  ))
);

/**
 * Serialize to checked list.
 * @param {Array} data -> The array of data.
 * @returns {Array} -> The serialized array.
 */
const toCheckedList = data => (
  data.map(item => ({
    ...item,
    id: shortid.generate(),
    checked: false
  }))
);

/**
 * Serialize to package reception orders summary.
 * @param {Array} data -> The array of data.
 * @returns {Array} -> The serialized array.
 */
const toOrdersSummary = data => (
  data.reduce((summary, order) => {
    const nextSummary = { ...summary };
    if (!nextSummary[order.StrZona]) {
      nextSummary[order.StrZona] = {};
    }

    if (!nextSummary[order.StrZona][order.StrTipoEmpaque]) {
      nextSummary[order.StrZona][order.StrTipoEmpaque] = {
        count: 0
      };
    }

    nextSummary[order.StrZona][order.StrTipoEmpaque]
      .count += parseInt(order.IntCantidad, 10);
    return nextSummary;
  }, {})
);

export default {
  toNewUser,
  toOrderToAssign,
  toOrderToDeliver,
  toDistributorUsers,
  toDataTableSet,
  toDeserializedDataTableSet,
  toDataTablePaginators,
  toCheckedList,
  toOrdersSummary
};

/**
 * Module with form validator.
 * @module src/shared/lib/validator
 */
// Utils.
import { string } from '../utils/';

// Constants.
import {
  STRING,
  NUMBER,
  OBJECT,
  ARRAY,
  CHECKED_LIST,
  REQUIRED
} from '../constants/types';

/**
 * Validate the data based on the type of the rule.
 * @param {String} type -> The type rule.
 * @param {Any} data -> The data to validate.
 * @returns {Bool} -> The result of the validation.
 */
const validateByType = (type, data) => ({
  [STRING]: data !== null && !string.empty(data),
  [NUMBER]: data !== null && !string.empty(data.toString()),
  [ARRAY]: data !== null && data.length > 0,
  [OBJECT]: data !== null && Object.keys(data).length > 0,
  [CHECKED_LIST]: (
    data !== null &&
    data.constructor === Array &&
    data.some(element => (element.checked))
  )
}[type]);

/**
 * Checks every prop based on a set of rules,
 * returns an object with the validation resume.
 * @param {Object} rules -> The set of rules.
 * @param {Object} data -> The form data.
 * @returns {Object} -> The data validation.
 */
const run = (rules, data) => {
  const resume = Object.keys(rules).reduce((validation, prop) => {
    let passed = true;
    if (rules[prop].rule === REQUIRED) {
      passed = validateByType(rules[prop].type, data[prop]);
    }

    return {
      ...validation,
      [prop]: passed
    };
  }, {});

  const valid = Object.keys(resume)
    .every(prop => (resume[prop]));

  return { resume, valid };
};

export default { run };

