            }
            return {
              ...distributor,
              assign: !distributor.assign
            };
          })
    }
  }),
  [ASSIGN_DISTRIBUTOR_REQUEST]: state => ({
    ...state,
    distributorForm: {
      ...state.distributorForm,
      isSubmitting: true
    }
  }),
  [ASSIGN_DISTRIBUTOR_SUCCESS]: state => ({
    ...state,
    distributorForm: {
      ...state.distributorForm,
      idTransporter: '',
      nameTransporter: '',
      distributors: state.distributorForm.distributors
        .map(distributor => ({
          ...distributor,
          assign: false
        }))
    },
    isSubmitting: false
  }),
  [ASSIGN_DISTRIBUTOR_FAILED]: state => ({
    ...state,
    distributorForm: {
      ...state.distributorForm,
      isSubmitting: false,
      failed: true
    }
  }),
  [UPDATE_TRANSPORTERS_FILTER]:
    filters.actionHandlers[UPDATE_TRANSPORTERS_FILTER]
};

export default createReducer(initialState, actionHandlers);

