/**
 * Module with the a set of authentication rules.
 * @module src/shared/utils/auth-rules
 */

// React - Redux.
import { routerActions } from 'react-router-redux';
import { UserAuthWrapper } from 'redux-auth-wrapper';

// App Config.
import * as routes from '../constants/routes';

// Constants.
import { ADMIN, TRANSPORTER } from '../constants/user-types';

// Rule when a user is authenticated it will
// be redirected to the Dashboard route.
const userIsAuthenticated = new UserAuthWrapper({
  authSelector: state => (state.user),
  redirectAction: routerActions.push,
  wrapperDisplayName: 'UserIsAuthenticated',
  predicate: user => (user.isAuth)
});

// Rule when a user is not authenticated it will
// be redirected to the Login route.
export const userIsNotAuthenticated = new UserAuthWrapper({
  authSelector: state => (state.user),
  redirectAction: routerActions.push,
  wrapperDisplayName: 'UserIsNotAuthenticated',
  predicate: user => (!user.isAuth),
  failureRedirectPath: () => (routes.LOGIN),
  allowRedirectBack: false
});

// Rule when a user is authenticated and also
// is of type ADMIN.
export const userIsAdmin = new UserAuthWrapper({
  authSelector: state => (state.user),
  redirectAction: routerActions.push,
  wrapperDisplayName: 'UserIsAdmin',
  predicate: user => (user.data.IdTipo === ADMIN),
  failureRedirectPath: () => (routes.DASHBOARD),
  allowRedirectBack: false
});

// Rule when a user is authenticated and also
// is of type TRANSPORTER.
export const userIsTransporter = new UserAuthWrapper({
  authSelector: state => (state.user),
  redirectAction: routerActions.push,
  wrapperDisplayName: 'UserIsTransporter',
  predicate: user => (user.data.IdTipo === TRANSPORTER),
  failureRedirectPath: () => (routes.DASHBOARD),
  allowRedirectBack: false
});

export default {
  userIsAuthenticated,
  userIsNotAuthenticated,
  userIsAdmin,
  userIsTransporter
};

/**
 * Module with the config of the router.
 * @module src/shared/containers/router
 */
// React.
import React from 'react';
import { Route, IndexRoute } from 'react-router';

// Utils.
import { authRules } from '../utils/';

// App Config.
import * as routes from '../constants/routes';

// Components.
import {
  App,
  NewUser,
  LoginContainer,
  Dashboard,
  UsersList,
  AssignTransporter,
  AssignDistributors,
  PackageReception,
  AssignOrders
} from '../../client/containers/';
import { NotFound } from '../components/';

/**
 * Chains auth wrappers to the react-router onEnter event.
 * @param {Array} listOfOnEnters -> The list of wrappers.
 * @returns {Function} -> The final connector callback.
 */
const onEnterChain = (...listOfOnEnters) => (store, nextState, replace) => {
  let redirected = false;
  const wrappedReplace = (...args) => {
    replace(...args);
    redirected = true;
  };
  listOfOnEnters.forEach((onEnter) => {
    if (!redirected) {
      onEnter(store, nextState, wrappedReplace);
    }
  });
};

/**
 * Configure the routes with the auth settings.
 * @param {Object} store -> The redux store.
 * @returns {Any} -> The list of routes.
 */
const configureRoutes = (store) => {
  /**
   * Connects the react-router onEnter event to the auth wrapper.
   * @param {Function} fn -> The onEnter callback.
   * @returns {Function} -> The connector function.
   */
  const connect = fn =>
    (nextState, replaceState) => fn(store, nextState, replaceState);

  const {
    userIsAuthenticated,
    userIsNotAuthenticated,
    userIsAdmin,
    userIsTransporter
  } = authRules;

  return (
    <Route path={routes.DASHBOARD} component={App}>
      <IndexRoute
        component={userIsAuthenticated(Dashboard)}
        onEnter={connect(userIsAuthenticated.onEnter)}
      />
      <Route
        path={routes.LOGIN}
        component={userIsNotAuthenticated(LoginContainer)}
        onEnter={connect(userIsNotAuthenticated.onEnter)}
      />
      <Route
        path={routes.USERS_LIST}
        component={userIsAuthenticated(userIsAdmin(UsersList))}
        onEnter={connect(onEnterChain(userIsAuthenticated.onEnter, userIsAdmin.onEnter))}
      />
      <Route
        path={routes.NEW_USER}
        component={userIsAuthenticated(userIsAdmin(NewUser))}
        onEnter={connect(onEnterChain(userIsAuthenticated.onEnter, userIsAdmin.onEnter))}
      />
      <Route
        path={routes.ASSIGN_TRANSPORTER}
        component={userIsAuthenticated(userIsAdmin(AssignTransporter))}
        onEnter={connect(onEnterChain(userIsAuthenticated.onEnter, userIsAdmin.onEnter))}
      />
      <Route
        path={routes.ASSIGN_DISTRIBUTORS}
        component={userIsAuthenticated(userIsAdmin(AssignDistributors))}
        onEnter={connect(onEnterChain(userIsAuthenticated.onEnter, userIsAdmin.onEnter))}
      />
      <Route
        path={routes.PACKAGE_RECEPTION}
        component={userIsAuthenticated(userIsTransporter(PackageReception))}
        onEnter={connect(onEnterChain(userIsAuthenticated.onEnter, userIsTransporter.onEnter))}
      />
      <Route
        path={routes.ROUTES_ASSIGN}
        component={userIsAuthenticated(userIsTransporter(AssignOrders))}
        onEnter={connect(onEnterChain(userIsAuthenticated.onEnter, userIsTransporter.onEnter))}
      />
      <Route path="*" component={NotFound} status={404} />
    </Route>
  );
};

export default configureRoutes;

/**
 * Module with the redux store configuration.
 * @module src/shared/utils/configure-store
 */

import { createStore, applyMiddleware, compose } from 'redux';
import { routerMiddleware } from 'react-router-redux';
import { createEpicMiddleware } from 'redux-observable';
import { persistState } from 'redux-devtools';

// Containers.
import { DevTools } from '../containers/';

// Epics.
import rootEpic from '../epics/';

// App Config.
import { env } from '../../../config/';

/**
 * Create a composed store.
 * @param {Object} history -> Browser history.
 * @param {Object} reducers -> App reducer.
 * @param {Object} initialState -> The initial state of the app.
 * @returns {Object} -> Redux store.
 */
const configureStore = (
  history,
  reducers,
  initialState = {}
) => {
  // Middlewares.
  const reduxRouterMiddleware = routerMiddleware(history);
  const epicMiddleware = createEpicMiddleware(rootEpic);
  let enhancer = applyMiddleware(reduxRouterMiddleware, epicMiddleware);

  if (env.DEBUG && _CLIENT_) {
    enhancer = compose(
      applyMiddleware(reduxRouterMiddleware, epicMiddleware),
      DevTools.instrument(),
      persistState(
        window.location.href.match(
          /[?&]debug_session=([^&#]+)\b/
        )
      )
    );
  }

  const store = createStore(reducers, initialState, enhancer);

  if (env.DEBUG && module.hot) {
    module.hot.accept('../reducers', () => {
      const nextReducers = require('../reducers').default; // eslint-disable-line global-require
      store.replaceReducer(nextReducers);
    });
  }

  return store;
};

export default configureStore;

/**
 * Module with some array helpers.
 * @module src/shared/utils/helpers/array
 */

/**
 * Returns the element in the array with a key.
 * @param {Array} arr -> The array source.
 * @param {Number} key -> The key of the element.
 * @return {Any} -> The element at the position.
 */
const get = (arr, key) => {
  if (key === null) {
    return arr[0];
  }

  if (key >= arr.length) {
    return null;
  }

  return arr[key];
};

/**
 * Search for a coincindence that matches a id prop.
 * @param {Array} arr -> The array source.
 * @param {Any} id -> The id to search for.
 * @return {Any} -> The element that matches the condition.
 */
const findIndexById = (arr, id) => (
  arr.reduce((result, element, index) => (
    (element.id === id) ? index : result
  ), 0)
);

/**
 * Flattens a two dimensional array.
 * @param {Array} arr -> The two dimensional array.
 * @returns {Array} -> The flatten array.
 */
const flat = arr => (
  arr.reduce((flattended, element) => {
    flattended.push(...element);
    return flattended;
  }, [])
);

export default { get, findIndexById, flat };

const generateComponentStyleConfig = (component, modifiers) => (
  modifiers.reduce((config, modifier) => (
    config + ((modifier) ? `${component}--${modifier} ` : '')
  ), '')
);

export default { generateComponentStyleConfig };

